def downloadFile(opener, url):
    file_name = url.split('/')[-1]
    resp = opener.open(url)
    BUFFER_SIZE = 8192
    
    f = open(file_name, 'wb')
    
    buffer = resp.read(BUFFER_SIZE)
    while buffer:
        f.write(buffer)
        buffer = resp.read(BUFFER_SIZE)
    
    f.close()
    
    
if __name__ == "__main__":
    main(ids)